import React from 'react';
import {
  List,
  Edit,
  Create,
  Datagrid,
  TextField,
  ReferenceField,
  EditButton,
  SimpleForm,
  TextInput
} from 'react-admin';

export const VoiceList = props => (
  <List {...props}>
    <Datagrid>
      <TextField label="Location" source="address" />
      <TextField source="report_users" />
      <TextField source="comments" />
      <EditButton />
    </Datagrid>
  </List>
);
